import { useState } from "react";
import CardImage from '../images/sample1.jpg';


const CheckOut = ({}) => {
  return (
    <div className="checkout" style={{ width: 400 }}>
      <div className="checkout-header">
        <i onClick={() => {}} className="fa fa-remove"></i>
        <h3>Card Details</h3>
        <img src={CardImage} alt="Sample Card" />
      </div>
      <div className="card-info">
          <ul>
              <li><input type="text" placeholder="Name On Card" /></li>
              <li><input type="text" placeholder="Card Number" /></li>
              <li><input type="day" /></li>
              <li><input type="text" /></li>
          </ul>
      </div>
    </div>
  );
};

export default CheckOut;
